import React, { useEffect } from "react";
import GetShipments from "./Queries/GetShipments";

const Shipments = () => {
  const { error, data, loading } = GetShipments(1);

  useEffect(() => {
    console.log(data);
  }, [loading]);

  if (loading) {
    return <p>Loading...</p>;
  }
  return (
    <div>
      {/* <div className="shipment">
        <p className="title">Waybill</p>
      </div> */}
      {data.user.shipments &&
        data.user.shipments.map((shipment, key) => (
          <div key={key} className="shipment">
            {key == 0 ? (
              <>
                <p>Waybill</p>
              </>
            ) : (
              <>
                <p>{key + 1}</p>
                <p>{shipment.waybill}</p>
                <div className="btns">
                  <button>update</button>
                  <button>delete</button>
                </div>
              </>
            )}
          </div>
        ))}
    </div>
  );
};

export default Shipments;
